import React from 'react';


import { Brand, Feature, Navbar} from './components';
import { Footer, Features, Header} from './containers';

import './App.css';

const App = () => (
    <div className="App">
        <Navbar />
      <body>
        <Header />
      <Brand />
      <Feature />
      <Features />
      <Footer />
      </body>

    </div>
  );

export default App;
